import React, {useState} from 'react'
import './Login.css'
import login2 from './login2.jpg'
import { useLocation } from 'react-router-dom';
export default function Login({ name }) {
  // const [isFormEnabled, setFormEnabled] = useState(true);
  // const enableForm = () => {
  //   setFormEnabled(false);
  // };

  const location = useLocation();
  const { officeEmail } = location.state;
  const namme=officeEmail;
  console.log(namme);//
  return (
    <div id='mainlogin'>
      <div className='main1'>
        <div className='login-container'>
          <form action='' name='' className='login-container'>
            <h1>{name}</h1>
            {/* <div>
                <button className='button' onClick={enableForm}>Admin</button>
                <button className='button' onClick={enableForm}>Employees</button>
              </div> */}
            <input type='text' className='input' placeholder='OTP' ></input>
            <input type='text' className='input' placeholder='Password' ></input>
            <input type='text' className='input' placeholder='Confirm Password' ></input>
            {/* <div className='forget'>Forget Password</div> */}
            <button className='button'>Submit</button>

          </form>
        </div>
      </div>
      <div className='main2'>
        <h1>Welcome Back</h1>
        <img src={login2} alt="Logo" />
      </div>
    </div>
  )
}
